import React, { Component } from "react";
import { Coins } from './data';

export const Table: React.FC = () => {
    return (
        <div>
            <h1 id='title'>React Dynamic Table</h1>
            <table id='coins'>
                <tbody>
                    <td>id</td>
                    <td>name</td>
                    <td>value</td>
                    <td>change</td>
                    {
                        Coins.map((coin, Index) => {
                            const { id, name, value, change } = coin //destructuring
                            return (
                                <tr key={id}>
                                    <td>{id}</td>
                                    <td>{name}</td>
                                    <td>{value}</td>
                                    <td>{change}</td>
                                </tr>)
                        })
                    }
                </tbody>
            </table>
        </div>
    )
};
